import React, { Component } from "react";
import axios from "axios";

class BookingStructure extends Component {
    constructor(props) {
        super(props);

        this.state = {
            moviedates: undefined,
        }
    }

    componentDidMount() {
        this.setState(this.props.moviedate);
    }


    render() {
        return (
            <tbody>
                {this.state.moviedates.map((moviedate) => {
                    <tr>
                        <td>
                            {moviedate}
                        </td>
                    </tr>
                })}
            </tbody>

        )
    }
}


export default BookingStructure;
